import trainer1 from '../frontend/Components/common/images/profile-img/Adam-Smith.jpg';
import trainer2 from '../frontend/Components/common/images/profile-img/Peter-Jones.jpg';

export default function getTrainers() {
    return [
        { 
            id: 'trainer1', 
            firstname: `Adam`, 
            lastname: `Smith`, 
            address: '123', 
            rate: 20,
            martialart: 'Tai-Chi',
            description: 'abc',
            trinerImage: trainer1,
        },
        { 
            id: 'trainer2', 
            firstname: 'Peter', 
            lastname: `Jones`, 
            address: '123', 
            rate: 30,
            martialart: 'Wing-Chun',
            description: 'abc',
            trinerImage: trainer2,
        },
    ];
}
